import React from 'react';
import propTypes from "prop-types"
import classNames from 'classnames';
import { Time, IconReaded } from "components"

import "./DialogItem.scss"

const getAvatar = avatar => {
    if (avatar) {
        return (
            <img
                src={avatar}
                alt=""
            />
        )
    } else {
        /* avatar default */
    }
}

const DialogItem = ({ user, message }) => {
    return <div className='dialogs__item'>
        <div className="dialogs__item-avatar">
            {/* <img src={user.avatar} alt={`${user.fullname} avatar`} /> */}
            {getAvatar("https://sun5-7.userapi.com/s/v1/if2/liqQM7RPMQ6ekwiheDA7E5FVhSS8KIO3-7DcgbPGIF_BPg-FGcEuZ0Vl2DRyf_ceGRHLBCFK76KVenJPYRB-Hh2n.jpg?quality=95&crop=338,0,643,643&as=50x50,100x100,200x200,400x400&ava=1&u=3ETenzU-9qgER76tYomdfbMFZdPi56oB0XArvFlkzho&cs=200x200")}
        </div>
        <div className="dialogs__item-info">
            <div className="dialogs__item-info-top">
                <b>Петрович</b>
                <span>
                    {/* {<Time date={new Date()}></Time>} */}
                    13:04
                </span>
            </div>
            <div className="dialogs__item-info-button">
                <p>
                    Ой горе горе то какое...{/*  А и кстати на счет презентации: сделал? */}
                </p>
                <IconReaded isMe={true} isReaded={false}></IconReaded>
            </div>
        </div>
    </div>
}


export default DialogItem;
